    key: "_CalculateClusterInfo",
    value: function _CalculateClusterInfo(resolution, vector, HeighCount, MediumCount, threshold) {
      var maxFeatureCount = 0;
      var features = vector.getSource().getFeatures();
      var feature, radius;

      for (var i = features.length - 1; i >= 0; --i) {
        feature = features[i];
        var originalFeatures = feature.get('features');
        maxFeatureCount = originalFeatures.length;
        if (originalFeatures.length > HeighCount) radius = 30;else if (originalFeatures.length > MediumCount) radius = 25;else if (originalFeatures.length >= 2 && originalFeatures.length <= threshold) radius = 20;else radius = 0;
        /*else if (originalFeatures.length == 1 || originalFeatures.length < threshold)
            radius = 0;
        else
            radius = 20;
        */

        feature.set('radius', radius);
      }

      return maxFeatureCount;
    }
